    [],nt"revision_timestamp": "2016-08-20T09:39:34.764579",nt"name": "palmyra-atoll-invasive-plant-management-eradicate-control-dab68",nt"isopen":
    false,nt"url": null,nt"notes": "Remote atoll ecosystems are havens of biological
    diversity, but vulnerable to ecological invasion. The prosperity of the plants and
    animals that inhabit remote atoll ecosystems are dependent on an intact healthy
    ecosystem free of invasive species. On Palmyra, invasive plants are unraveling well
    established relationships between terrestrial organisms, by crowding out native
    species and completely altering the landscape and habitat. Several of these invasive
    species are nitrogen fixing and/or allelopathic, and can cause wholesale ecosystem
    shifts when they become dominant. This project will initiate a proactive, adaptive
    and integrated invasive species management approach to curtail and prevent the furtherinfluence
    of invasive plants and trees on private and refuge lands at Palmyra. This two year
    project will focus on: 1) Restoration of biological habitat integrity through chemical
    and mechanical control/eradication of focal invasive speciesu037e 2) Volunteer training
    in the detection, eradication, and control methods so that no lag time occurs by
    the response team following the detection of an invasionu037e 3) Early Detection
    Rapid Response efforts, as outlined in the Biosecurity Plan for Palmyra, to detect
    new invasive species and increase the likelihood that invasions are localized and
    within containment/eradication capabilitiesu037e and 4)Adaptive Management through
    post-treatment monitoring and sampling to measure the extent to which our actions
    contribute to positive change and assure the highest return on our investments.",nt"license_title":
